def pipe_test():
    """
    测试pipe+ hmget会不会乱序返回
    结果是不会乱序
    :return:
    """
    redis_setting = {'host': '127.0.0.1', 'port': 6379, 'password': '123456', 'db': 7}
    __redis_manager = RedisManager(redis_setting)
    code = ['300001', '300002', '300003', '300004', '300005', '300006', '300007', '300008', '300009', '300010']
    code = code*2
    print('code:{}'.format(code))
    indication = ['operating_costs', 'goodwill', 'net_cash_flows_oper_act', 'plus_non_oper_rev',
                  'less_non_oper_exp', 'impairtog', 'fin_assets_avail_for_sale', 'cash_cash_equ_beg_period',
                  'lt_borrow', 'oth_cur_liab', 'dvd_payable', 'notes_payable']

    pipe = __redis_manager.pipeline()
    for i in code:
        pipe.hmget(name='stkRealTimeState:{}_14901'.format(i), keys=indication)
    result = pipe.execute()
    print('len:{}'.format(len(result)))
    print('result:{}'.format(result))

    for j in range(100):
        pipe = __redis_manager.pipeline()
        for i in code:
            pipe.hmget(name='stkRealTimeState:{}_14901'.format(i), keys=indication)
        result_tmp = pipe.execute()
        # print(result_tmp)
        if result_tmp != result:
            print('有不相等的result:{}\n,result_tmp:{}'.format(result, result_tmp))
