def generate_name(names):
        """
        将取到的今日板块进行筛选，没有的就删除
        :param names:
        :return:
        """
        _new_names = []
        for __name in names:
            __name_list = __name.split(':')
            print(__name_list)
            __one = __name_list[0] + 'Index:'
            __two = __name_list[1] + ':'
            __three = __name_list[2].split('_')[-1]
            __new_name = __one + __two + __three
            _new_names.append(__new_name)
        return _new_names


