def get_plate_name():
        """
        得到所有的plate 的name
        :return:
        """
        _new_names = []
        __names = rediss.keys(name='stkPlateState:*')
        for __name in __names:
            __result = __name.split(':')
            __new_name = 'stkRealTimeState:' + __result[1]
            _new_names.append(__new_name)
        return _new_names
